  const [ isloggedIn, setLoggedIn ] = useState(true);
  const [ userId, setUserId ] = useState(1)

  return (
    <div className="App">
    <Nav />

    <Switch>
    <Route exact path="/users" component={User} isloggedIn={isloggedIn} userId/>

    </Switch>
    </div>
  );
}

export default App;
